import React from 'react'
import { GoogleMap,Marker,useLoadScript} from '@react-google-maps/api';

const MapContainer=(props)=>{

    const{isLoaded}=useLoadScript({googleMapsApiKey:'AIzaSyCbHVClKTILxFe3bJTShVUWJimPKJRqhyE'})
    console.log(props.tripArr)
    const markers=props.tripArr.map((place)=>{
        return <Marker position={{lat:place.lattitude,lng:place.longitude}}/>
    })

    return(
    <GoogleMap zoom={10} center={{lat:props.loc.lattitude,lng:props.loc.longitude}} mapContainerClassName="">
        {markers}
    </GoogleMap>
    )
}

export default MapContainer
